import React, { useState, useEffect } from 'react';
import { Link, Routes, Route, useLocation } from 'react-router-dom';

const PatientDashboard = () => {
  const location = useLocation();
  const [patient, setPatient] = useState(null);

  useEffect(() => {
    // Simulation des données patient (à remplacer par une API)
    setPatient({
      nom: 'Diop',
      prenom: 'Aminata',
      age: 32,
      sexe: 'F',
      groupeSanguin: 'O+',
    });
  }, []);

  if (!patient) {
    return <p>Chargement...</p>;
  }

  return (
    <div style={{ display: 'flex', minHeight: '100vh' }}>
      
      {/* MENU LATÉRAL */}
      <aside style={{ width: '250px', background: '#0d6efd', color: '#fff', padding: '20px' }}>
        <h3>Patient</h3>
        <nav>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li><Link style={linkStyle} to="">Tableau de bord</Link></li>
            <li><Link style={linkStyle} to="dossier">Dossier médical</Link></li>
            <li><Link style={linkStyle} to="rendez-vous">Rendez-vous</Link></li>
            <li><Link style={linkStyle} to="ordonnances">Ordonnances</Link></li>
            <li><Link style={linkStyle} to="analyses">Analyses</Link></li>
          </ul>
        </nav>
      </aside>

      {/* CONTENU PRINCIPAL */}
      <main style={{ flex: 1, padding: '20px' }}>
        <Routes>

          {/* DASHBOARD */}
          <Route
            index
            element={
              <>
                <h2>Bienvenue {patient.prenom} {patient.nom}</h2>
                <p>Voici votre espace personnel de santé.</p>

                <div style={cardContainer}>
                  <div style={card}>Âge : {patient.age} ans</div>
                  <div style={card}>Sexe : {patient.sexe}</div>
                  <div style={card}>Groupe sanguin : {patient.groupeSanguin}</div>
                </div>
              </>
            }
          />

          {/* DOSSIER MÉDICAL */}
          <Route
            path="dossier"
            element={
              <>
                <h2>Dossier médical</h2>
                <ul>
                  <li>Antécédents : Aucun</li>
                  <li>Allergies : Pénicilline</li>
                  <li>Maladies chroniques : N/A</li>
                </ul>
              </>
            }
          />

          {/* RENDEZ-VOUS */}
          <Route
            path="rendez-vous"
            element={
              <>
                <h2>Mes rendez-vous</h2>
                <ul>
                  <li>10/02/2026 - Consultation générale</li>
                  <li>18/02/2026 - Cardiologie</li>
                </ul>
              </>
            }
          />

          {/* ORDONNANCES */}
          <Route
            path="ordonnances"
            element={
              <>
                <h2>Ordonnances</h2>
                <ul>
                  <li>Paracétamol – 3x/jour</li>
                  <li>Vitamine C – 1x/jour</li>
                </ul>
              </>
            }
          />

          {/* ANALYSES */}
          <Route
            path="analyses"
            element={
              <>
                <h2>Analyses médicales</h2>
                <ul>
                  <li>Analyse sanguine – Normale</li>
                  <li>Glycémie – Stable</li>
                </ul>
              </>
            }
          />

        </Routes>
      </main>
    </div>
  );
};

const linkStyle = {
  display: 'block',
  padding: '10px',
  color: '#fff',
  textDecoration: 'none'
};

const cardContainer = {
  display: 'flex',
  gap: '15px',
  marginTop: '20px'
};

const card = {
  background: '#f8f9fa',
  padding: '15px',
  borderRadius: '8px',
  minWidth: '150px',
  textAlign: 'center',
  boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
};

export default PatientDashboard;
